import { useState } from 'react'
import { useQuery } from 'react-query'

import { getAllStatuses } from '../services/statusService'

export const useStatusGet = () => {
  const { 
    data, status 
  } = useQuery<String[], string>(
    'statuses', 
    getAllStatuses
  )
  return [data, status]
}
